from collections import defaultdict
import heapq

def evaluate_training_pairs(M, N, new_subjects, current_subjects, G, H):
    st = defaultdict(list)
    pr = defaultdict(list)
    for (u, v) in new_subjects:
        heapq.heappush(st[u], v)
    for (u, v) in current_subjects:
        heapq.heappush(pr[u], v)
    gc = hc = 0
    for (k, v) in st.items():
        if k in pr:
            p = s = 0
            ngc = 0
            lprk = len(pr[k])
            lv = len(v)
            while p < lprk and s < lv:
                if pr[k][p] >= v[s]:
                    p += 1
                    s += 1
                    hc += 1
                else:
                    p += 1
                    ngc += 1
            if ngc - (lv - s) > 0:
                gc += lv - s
            else:
                gc += ngc
    gc -= hc
    if gc >= G and hc >= H:
        return 'Great'
    elif gc >= G:
        return 'Good'
    else:
        return ':('

